import React, { useEffect } from 'react';
import fetch from 'node-fetch'



function HomePage() {
  useEffect(() => {
    let data = ''
    fetch('http://localhost:3001/users/all')
    .then(res => {
      data = res.text()
      res.text()
    })
    .then(body => console.log(body));
  });
  return (
  <div>
    Welcome to Next.js!
    <div>
      {data}
    </div>
  </div>
  )
}

export default HomePage
